import styled from "styled-components";
import { Link } from "react-router-dom";

export const HeaderComponent = styled.div`
  width: 100%;
  min-width: 600px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 25px;
`;

export const LogoContainer = styled(Link)`
  height: 100%;
  width: 70px;
  padding: 25px;
`;
